import React, { useState } from 'react';

function PetTable({ pets, onUpdate, onDelete }) {
  const [editPetId, setEditPetId] = useState(null);
  const [formData, setFormData] = useState({});

  const handleEditClick = (pet) => {
    setEditPetId(pet.idMascota);
    setFormData({ ...pet });
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = () => {
    onUpdate(formData);
    setEditPetId(null);
  };

  const handleCancel = () => {
    setEditPetId(null);
    setFormData({});
  };

  return (
    <table border="1" cellPadding="10">
      <thead>
        <tr>
          <th>ID</th><th>Nombre</th><th>Especie</th><th>Raza</th><th>Fecha Nacimiento</th><th>ID Due√±o</th><th>Acciones</th>
        </tr>
      </thead>
      <tbody>
        {pets.map(pet => (
          editPetId === pet.idMascota ? (
            <tr key={pet.idMascota}>
              <td>{pet.idMascota}</td>
              <td><input name="nombre" value={formData.nombre || ''} onChange={handleChange} /></td>
              <td><input name="especie" value={formData.especie || ''} onChange={handleChange} /></td>
              <td><input name="raza" value={formData.raza || ''} onChange={handleChange} /></td>
              <td><input name="fechaNacimiento" value={formData.fechaNacimiento ? formData.fechaNacimiento.slice(0,10) : ''} type="date" onChange={handleChange} /></td>
              <td>{pet.duenio?.ownerId || ''}</td>
              <td>
                <button onClick={handleSubmit}>Guardar</button>
                <button onClick={handleCancel}>Cancelar</button>
              </td>
            </tr>
          ) : (
            <tr key={pet.idMascota}>
              <td>{pet.petId}</td>
              <td>{pet.name}</td>
              <td>{pet.species}</td>
              <td>{pet.breed}</td>
              <td>{pet.birthDate ? pet.fechaNacimiento.slice(0,10) : ''}</td>
              <td>{pet.duenio?.ownerId || ''}</td>
              <td>
                <button onClick={() => handleEditClick(pet)}>Editar</button>
                <button onClick={() => onDelete(pet.idMascota)}>Eliminar</button>
              </td>
            </tr>
          )
        ))}
      </tbody>
    </table>
  );
}

export default PetTable;
